import React, { Component } from 'react';

class Container extends Component {
    render() {
        return (
            <div style={ containerStyle } id="Container">
                <style jsx>
                    { `
                    #Container {
                      margin: "0 2%";
                    }
                    `}
                </style>
                { this.props.children }
            </div>);
    }
}
export default Container;
